import React from "react";
import img1 from "./images/qrsw.png";
import img2 from "./images/wiz.png";
import "./Commitments.css";

function Commitments() {
  return (
    <div className = "commits">

      <h2> We believe in the QRSW Quartet! </h2>
      <div className = "commits-row"> 
      <img className = "qrsw" src = {img1} alt = "Loading! We will be back in a sec?" />
       
    <h2> </h2>
      
      </div>
    </div>
  );
}

export default Commitments;
